    false,nt"url": null,nt"notes": "This annual narrative report for Meredosia
    National Wildlife Refuge outlines Refuge accomplishments during the 1980 calendar
    year. The report begins with an introduction to the Refuge and system status. Refuge
    construction and maintenance are also described. Habitat management is covered;
    croplands, grasslands, wetlands, and wilderness and special areas are discussed.
    The wildlife section of the report discusses endangered and threatened species,
    migratory birds, mammals, and big game animals. Interpretation and recreation activities
    are outlined; topics include information and interpretation and law enforcement.
    Items of interest and safety are discussed. Photographs are attached.",nt"license_title":
